import React, { Component } from 'react'
import classes from './QuizList.module.css'

export default class QuizList extends Component {

  renderQuizes() {
    return [1, 2, 3].map((quiz, index) => {
      return(
        <li></li>
      )
    })
  }

  render() {
    return (
      <div className={classes.QuizList}>
        <h1>Quiz list</h1>

        <ul>
          {this.renderQuizes()}
        </ul>
      </div>
    )
  }
}
